package _915_Number_of_Wonderful_Substrings

import "testing"

func Test_wonderfulSubstrings(t *testing.T) {
	type args struct {
		word string
	}
	tests := []struct {
		name string
		args args
		want int64
	}{
		{
			name: "large",
			args: args{""},
			want: 42762841,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := wonderfulSubstrings(tt.args.word); got != tt.want {
				t.Errorf("wonderfulSubstrings() = %v, want %v", got, tt.want)
			}
			if got := wonderfulSubstrings2(tt.args.word); got != tt.want {
				t.Errorf("wonderfulSubstrings2() = %v, want %v", got, tt.want)
			}
		})
	}
}
